    }

    /**
     * 打开模态框
     */
    const openImportProperty = () => {
        showImportPropertyModal.value = true
    }

    return {
        showImportPropertyModal, // 模态框打开
        importPropertySubmit, // 表单提交事件
        openImportProperty, // 打开模态框
    }

}
